import React, { Component } from 'react'

export class VoucherDetails extends Component {
  render() {
    //get the data from event items and pass the data through props
    return (
        <div className='button-container'>
          <button type="button" onClick={this.addtocart.bind(this.props.eventdetails)} className="btn btn-primary">{ this.props.details.Amount } for { this.props.details.Type }</button>
        </div>
      )
  }
}

export default VoucherDetails
